import React from 'react';
import './SlideCarousel.css';

class SlideCarousel extends React.Component {
  render() {
    return (
      <div id="carouselExampleControls" className="carousel slide" data-bs-ride="carousel">
        <div className="carousel-inner">
          <div className="carousel-item active">
            <img 
              src="https://images.unsplash.com/photo-1470071459604-3b5ec3a7fe05" 
              className="d-block w-100 carousel-image" 
              alt="Landscape" 
            />
            <div className="carousel-caption">
              <h3>Explore the Beauty of Nature</h3>
              <p>Immerse yourself in stunning landscapes and unique experiences.</p>
            </div>
          </div>

          {/* Additional slides omitted for brevity */}

        </div>

        {/* Carousel controls omitted for brevity */}

      </div>
    );
  }
}

export default SlideCarousel;
